import './App.css';

function App() {
  return (
    <div class="container">
      <div class="text">
        <h1>Login</h1>
        <input type="email" placeholder="Email" />
        <input type="password" placeholder="Password" />
        <button>Login</button>
      </div>
    </div>
  );
}

export default App;
